 fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Shfaq një arkiv etiketash postimesh. Kjo gjedhe do të shërbejë si rrugëdalje, kur s’gjendet dot një gjedhe më specifike (p.sh., Etiketë: Byrek).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Shfaq një arkiv postimesh për kur është vizituar një datë e caktuar (p.sh., example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Shfaq një arkiv klasifikimesh vetjake. Ashtu si kategoritë dhe etiketat, klasifikime kanë terma që i përdorni për të klasifikuar gjëra. Për shembull, një klasifikim me emrin “Art” mund të ketë disa terma, f.v., “Modern” dhe “Shekulli XVIII”. Kjo gjedhe shërben si rrugëdalje, kur s’gjendet dot një gjedhe më specifike (p.sh., Klasifikim: Art).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Shfaq një arkiv kategorish postimi. Kjo gjedhe do të shërbejë si rrugëdalje, kur s’gjendet dot një gjedhe më specifike (p.sh., Kategori: Receta).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Shfaq arkiv postimesh të një autori të vetëm. Kjo gjedhe do të shërbejë si rrugëdalje, kur s’gjendet dot një gjedhe më specifike (p.sh., Autor: Përgjegjës).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Shfaq çfarëdo arkivi, përfshi postime nga një autor i vetëm, kategori, etiketë, klasifikim, lloj vetjak postimesh dhe datë. Kjo gjedhe do të shërbejë si rrugëdalje, kur s’gjendet dot një gjedhe më specifike (p.sh., Kategori ose Etiketë).','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Shfaq një faqe statike, veç nëse mbi faqen është aplikuar një gjedhe vetjake, ose ekziston një gjedhe enkas.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Shfaq postime njëshe në sajtin tuaj, veç në qoftë aplikuar mbi atë postim një gjedhe e përshtatur, ose nëse ekziston një gjedhe enkas.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Shfaq çfarëdo zëri njësh, bie fjala, një postim, ose një faqe. Kjo gjedhe do të shërbejë si rrugëzgjidhje, kur s’mund të gjendet një gjedhe më specifike (p.sh., Postim Njësh, Faqe, ose Bashkëngjitje).','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Shfaq faqen hyrëse të sajtit tuaj, qoftë kur është ujdisur për të shfaqur postimin e fundit, qoftë një faqe statike. Gjedhja “Faqe Ballore” ka përparësi mbi krejt gjedhet.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Shfaq postimet më të reja, si një faqe hyrëse sajti, ose si “Faqja e postimeve”, siç përcaktohet te rregullimet mbi leximin. Nëse ekziston, gjedhja e Faqes Ballore anashkalon këtë gjedhe, kur postimet shfaqen te faqja hyrëse.','Used as a fallback template for all pages when a more specific template is not defined.'=>'E përdorur si gjedhe rrugëdalje për krejt faqet, kur s’ka të përcaktuar një gjedhe më specifike.','Block patter