###DEBUG###

###DETAILS###'=>'Njatjeta!

WordPress-i ka një veçori të brendshme që pikas raste gabimesh fatale të shkaktuara nga një shtojcë ose temë në sajtin tuaj dhe ju njofton me një email të automatizuar.
###CAUSE###
Së pari, vizitoni sajtin tuaj (###SITEURL###) dhe kontrolloni për çfarëdo problemi të dukshëm. Më pas, vizitoni faqen ku u pikas gabimi (###PAGEURL###) dhe kontrolloni për çfarëdo problemi të dukshëm.

###SUPPORT###

Nëse sajti juaj duket i dëmtuar dhe s’mund të hyni te pulti si normalisht, WordPress-i tani ka një “mënyrë rikthimi” speciale. Kjo ju lejon të hyni pa rrezik te pulti juaj dhe të hetoni më tej.

###LINK###

Për ta mbajtur të parrezik sajtin tuaj, kjo lidhje do të skadojë pas ###EXPIRES###. Por mos u shqetësoni për të: nëse gabimi ndodh sërish, pasi të skadojë lidhja, do t’ju dërgohet me email një lidhje e re.

Kur të kërkohet ndihmë për këtë problem, mund t’ju kërkohen disa nga hollësitë vijuese:
