###SITEURL###','Pending'=>'Pezull','request statusCompleted'=>'E plotësuar','request statusFailed'=>'E dështuar','request statusConfirmed'=>'E konfirmuar','request statusPending'=>'Pezull','Comment URL'=>'URL Komenti','Comment Content'=>'Lëndë Komenti','Comment Date'=>'Datë Komenti','Comment Author User Agent'=>'Agjent Përdoruesi Autori Komenti','Comment Author IP'=>'IP Autori Komenti','Comment Author URL'=>'URL Autori Komenti','Comment Author Email'=>'Email Autori Komenti','Comment Author'=>'Autor Komenti','WordPress Comments'=>'Komente WordPress','Limit result set to users who are considered authors.'=>'Kufizoje grupin e përfundimeve te përdorues që konsiderohen autorë.','Sorry, you are not allowed to query users by this parameter.'=>'Na ndjeni, s’keni leje të kërkoni te përdoruesit sipas këtij parametri.','media itemsMine'=>'Të miat','Whether or not the post type can be viewed.'=>'Nëse mund të shihet apo jo lloji i postimit.','The link you followed has expired.'=>'Lidhja që ndoqët ka skaduar.','You need a higher level of permission.'=>'Ju duhet leje e një shkalle më të lartë.','Something went wrong.'=>'Diç shkoi ters.','%s is already customizing this changeset. Do you want to take over?'=>'%s po e ndryshon tashmë këtë grup ndryshimesh. Doni ta merrni përsipër?','%s is already customizing this changeset. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s po e ndryshon tashmë këtë grup ndryshimesh. Ju lutemi, që të provoni ta ndryshoni, pritni deri sa të mbarojë. Ndryshimet tuaja të fundit janë vetëruajtur.','Update anyway, even though it might break your site?'=>'Të përditësohet, edhe pse kjo mund të nxjerrë jashtë pune sajtin tuaj?','The query only expected one placeholder, but an array of multiple placeholders was sent.'=>'Për kërkesën pritej vetëm një vendmbajtëse, por u dërgua një matricë vendmbajtësesh.','customizer changeset statusScheduled'=>'Planifikuar për zbatim','themeInstalled'=>'E instaluar','%1$s is not a valid property of Object.'=>'%1$s s’është veti e vlefshme e Objektit.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'S’do të jeni ende në gjendje të instaloni tema të reja nga këtu, ngaqë instalimi juaj lyp kredenciale SFTP. Hëpërhë, ju lutemi <a href="%s">temat shtojini që nga menuja e përgjegjësit</a>.','categoriesMost Used'=>'Më Të Përdorurat','tagsMost Used'=>'Më Të Përdorurat','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Klikoni mbi “Pasuesi” që të filloni të shtoni lidhje te menuja juaj e re.','customizer changeset action/button labelSchedule'=>'Vëreni në plan','+ Create New Menu'=>'+ Krijoni Menu të Re','Create a menu for this location'=>'Krijoni një menu për këtë vend','Could not open handle for %1$s to %2$s.'=>'S’u hap dot trajtuesi për %1$s te %2$s.','Add a navigation menu to your sidebar.'=>'Shtoni te paneli juaj një menu lëvizjesh.','%s has taken over and is currently customizing.'=>'Tani e ka marrë në dorë %s dhe po e përpunon.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'Duket se diç shkoi ters. Prisni pak sekonda dhe mandej riprovoni.','Take over'=>'Merreni në dorë','Go back'=>'Kthehu mbrapsht','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s është tashmë duke e përshtatur këtë sajt. Ju lutemi, prisni derisa të kenë mbaruar së provuari përshtatje. Ndryshimet tuaja më të reja u vetëruajtën.','%s is already customizing this site. Do you want to take over?'=>'%s është duke e përpunuar tashmë këtë sajt. Doni ta merrni ju në dorë?','Sorry, you are not allowed to take over.'=>'Na ndjeni, s’keni leje ta merrni në dorë.','No changeset found to take over'=>'S’u gjet grup ndryshimesh për ta marrë në dorë','Security check failed.'=>'Kontrolli i sigurisë dështoi.','Changeset is being edited by other user.'=>'Grupi në fjalë i ndryshimeve po përpunohet nga përdorues tjetër.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Ky është vendi ku shfaqet kjo menu. Nëse doni ta ndryshoni, zgjidhni një vend tjetër.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(Nëse keni në plan të përdorni një <a href="%1$s" %2$s>widget%3$s</a> menush, anashkalojeni këtë hap.)','menu locationsWhere do you want this menu to appear?'=>'Ku do të donit të shfaqet kjo menu?','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Do të krijoni një menu, do t’i caktoni një vend dhe do të shtoni elementë menuje, të tillë si lidhje te faqe dhe kategori. Nëse tema juaj ka shumë fusha menush, mund të donit të krijoni më shumë se një.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Nuk duket se sajti juaj ka ende ndonjë menu. Doni të krijoni një të tillë? Klikoni butonin që t’ia fillohet.','menu locationsView All Locations'=>'Shihni Krejt Vendet','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Teksa i bëni paraparje një teme të re, mund të vazhdoni të krijoni sipas dëshirës gjëra të tilla si widget-e dhe menu, si dhe të eksploroni mundësi specifike të temës.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Po shihni për një temë? Mund të kërkoni ose shfletoni te drejtoria e temave në WordPress.org, instaloni dhe bëni paraparje temash, mandej t’i aktivizoni drejt e këtu.','menu locationsView Location'=>'Shihni Vendin','No themes found. Try a different search.'=>'S’u gjetën tema. Provoni kërkim tjetër.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Tema juaj mund të shfaqë menu në një vend. Përzgjidhni cilën menu do të donit të përdorni.','Site Name: %s'=>'Emër Sajti: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'Kërkesa nuk përmban numrin e saktë të vendmbajtëseve (%1$d) për numrin e argumenteve të dhënë (%2$d).','Unsupported value type (%s).'=>'Lloj i pambuluar vlere (%s).','Widgets need to be registered using %s, before they can be displayed.'=>'Widget-et lypset të jenë regjistruar duke përdorur %s, përpara se të mund të shfaqen.','Link to:'=>'Lidhje për te:','No images selected'=>'S’u përzgjodhën figura','Displays an image gallery.'=>'Shfaq një galeri figurash.','Gallery'=>'Galeri','Custom HTML Widget'=>'Widget HTML-je Vetjake','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'Përdoreni widget-in HTML Vetjake për të shtuar kod HTML arbitrar te fushat tuaja të widget-eve.','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'Adresa juaj email s’është përditësuar ende. Ju lutemi, kontrolloni te email-et tuaj te %s për një email ripohimi.','Howdy ###USERNAME###,

