###SITEURL###','Only UUID V4 is supported at this time.'=>'Deri sot mbulohet vetëm UUID V4.','The Press This plugin is required.'=>'Lypset shtojca Press This.','%s themes'=>'%s tema','Filter themes (%s)'=>'Filtroni tema (%s)','Go to theme sources'=>'Shko te burime teme','Search WordPress.org themes'=>'Kërkoni te temat WordPress.org','Install &amp; Preview'=>'Instalim &amp; Paraparje','Invalid URL.'=>'URL e Pavlefshme.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Erdhi koha të shtohen ca lidhje! Klikoni mbi “%s”, që të filloni të vendosni në menunë tuaj faqe, kategori dhe lidhje vetjake. Shtoni aq gjëra sa doni.','Choose image'=>'Zgjidhni figurë','Choose audio'=>'Zgjidhni audio','Change audio'=>'Ndryshoni audio','Select audio'=>'Përzgjidhni audio','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikoni mbi “Shtoni Figurë të Re”, që të ngarkoni një kartelë figure që nga kompjuteri juaj. Tema juaj funksionon më mirë me një figurë me lartësi kryeje %s piksel &#8212; që ta nxërë fiks, do të jeni në gjendje ta qethni figurën tuaj, pasi ta keni ngarkuar.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikoni mbi “Shtoni Figurë të Re”, që të ngarkoni një kartelë figure që nga kompjuteri juaj. Tema juaj funksionon më mirë me një figurë me gjerësi kryeje %s piksel &#8212; që ta nxërë fiks, do të jeni në gjendje ta qethni figurën tuaj, pasi ta keni ngarkuar.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikoni mbi “Shtoni Figurë të Re”, që të ngarkoni një kartelë figure që nga kompjuteri juaj. Tema juaj funksionon më mirë me një figurë me madhësi kryeje %s piksel &#8212; që ta nxërë fiks, do të jeni në gjendje ta qethni figurën tuaj, pasi ta keni ngarkuar.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikoni mbi “Shtoni Figurë të Re”, që të ngarkoni një kartelë figure që nga kompjuteri juaj. Tema juaj funksionon më mirë me një figurë që përkon me madhësinë e videos tuaj &#8212; që ta nxërë fiks, do të jeni në gjendje ta qethni figurën tuaj, pasi ta keni ngarkuar.','%1$s-%2$s'=>'%1$s - %2$s','Meridian'=>'Meridian','Minute'=>'Minutë','Hour'=>'Orë','Time'=>'Kohë','Day'=>'Ditë','Month'=>'Muaj','Date'=>'Datë','Usage of user levels is deprecated. Use capabilities instead.'=>'Përdorimi i niveleve të përdoruesit është nxjerrë nga përdorimi. Në vend të tyre përdorni aftësitë.','The theme defines itself as its parent theme. Please check the %s header.'=>'Tema e përcakton veten si temë mëmë e vetvetes. Ju lutemi, kontrolloni kryet e %s.','Name for the Visual editor tabVisual'=>'Pamor','Create New Menu'=>'Krijoni Menu të Re','New Menu'=>'Menu e Re','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Nëse tema juaj ka fusha widget-esh, atje mund të shtoni edhe menu. Vizitoni <a href="%s">panelin Widget-e</a> dhe shtoni një “<em>widget</em> Menuje Lëvizjesh” që të shfaqet një menu në një anështyllë apo fundfaqe.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Nëse tema juaj ka shumë menu, dhënia për to e emrave të qartë do t’ju ndihmojë në administrimin e tyre.','Your theme can display menus in %s location.'=>'Tema juaj mund të shfaqë menu në %s vend.' . "\0" . 'Tema juaj mund të shfaqë menu në %s vende.','Your theme can display menus in one location.'=>'Tema juaj mund të shfaqë menu në një vend.','CSS code'=>'Kod CSS','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Te fusha e përpunimeve, sintaksa e kodit theksohet vetvetiu. Që të punoni nën mënyrën tekst i thjeshtë, këtë mund ta çaktivizoni te <a href="%1$s" %2$s>profili juaj i përdoruesit%3$s</a>.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Përdorues të lexuesit të ekranit: kur gjendeni nën mënyrën formular, mund t’ju duhet ta shtypni tastin Esc dy herë.','To move away from this area, press the Esc key followed by the Tab key.'=>'Që të largoheni nga kjo fushë, shtypni tastin Esc të ndjekur nga tasti Tab.','In the editing area, the Tab key enters a tab character.'=>'Te fusha e përpunimeve, tasti Tab fut një shenjë tab.','When using a keyboard to navigate:'=>'Kur për lëvizje përdoret tastierë:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Shtoni këtu kodin tuaj CSS që të përshtatni pamjen dhe skicimin e sajtit tuaj.','Your homepage displays'=>'Faqja juaj hyrëse shfaq','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Mund të zgjidhni se çfarë paraqitet në faqen hyrëse të sajtit tuaj. Mund të jenë postime në rend kohor së prapthi (blog klasik), ose një faqe e fiksuar/statike. Për të caktuar një faqe statike, së pari lypset të krijoni dy Faqe. Njëra do të jetë faqja hyrëse, ndërsa tjetra do të jetë ajo ku shfaqen postimet tuaja.','Homepage Settings'=>'Rregullime Faqeje Hyrëse','WordPress.org themes'=>'Tema WordPress.org','Installed themes'=>'Tema të instaluara','Publish Settings'=>'Rregullime Botimi','Copied'=>'U kopjuan','Preview Link'=>'Lidhje Paraparjesh','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Shihni se si do të dukeshin <em>live</em> ndryshimet në sajtin tuaj dhe ndajeni paraparjen me persona që s’hyjnë dot te Përshtatësi.','Share Preview Link'=>'Ndani Lidhje Paraparjesh Me të Tjerët','Changes trashed successfully.'=>'Ndryshimet u shpunë me sukses te hedhurinat.','Changes have already been trashed.'=>'Ndryshimet janë kaluar tashmë te hedhurinat.','Unable to trash changes.'=>'S’arrihet të shpihen ndryshimet te hedhurinat.','No changes saved yet, so there is nothing to trash.'=>'Ende pa ruajtje ndryshimesh, kështu që s’ka ç’të shpihet në hedhurina.','There was an authentication problem. Please reload and try again.'=>'Pati një gabim mirëfilltësimi. Ju lutemi, ringarkojeni faqen dhe riprovoni.','Unable to save due to %s invalid setting.'=>'S’arrihet të ruhet, për shkak të %s rregullimi të pavlefshëm.' . "\0" . 'S’arrihet të ruhet, për shkak të %s rregullimesh të pavlefshme.','You must supply a future date to schedule.'=>'Për vënie në plan duhet të jepni një datë në të ardhmen.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Grupi i mëparshëm i ndryshimeve është botuar tashmë. Ju lutemi, riprovoni ruajtjen e grupit tuaj të tanishëm të ndryshimeve.','Edit User'=>'Përpunoni Përdoruesin','View User'=>'Shiheni Përdoruesin','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Ky <em>widget</em> mund të ketë përmbajtur kod që mund të punojë më mirë me widget-in “HTML Vetjake”. Nëse s’e keni bërë 