 “Anuloje” që të ndalet, “OK” që të fshihen.','Suggested image dimensions: %1$s by %2$s pixels.'=>'Përmasa të këshilluara për figurën: %1$s me %2$s piksela.','Sorry, comments are not allowed for this item.'=>'Na ndjeni, për këtë objekt nuk lejohen komente.','Sorry, you are not allowed to make proxied oEmbed requests.'=>'Na ndjeni, s’keni leje të bëni kërkesa oEmbed të ndërmjetësuara.','Whether to perform an oEmbed discovery request for unsanctioned providers.'=>'Të bëhet apo jo një kërkesë zbulimi oEmbed për furnizues jo të sanksionuar.','The maximum height of the embed frame in pixels.'=>'Lartësia maksimum e kornizës për trupëzim, në piksela.','The maximum width of the embed frame in pixels.'=>'Gjerësia maksimum e kornizës për trupëzim, në piksela.','The oEmbed format to use.'=>'Formati oEmbed për t’u përdorur.','The URL of the resource for which to fetch oEmbed data.'=>'URL-ja e burimit për të cilin të sillen të dhëna oEmbed.','Short for blue in RGBB'=>'B','Short for green in RGBG'=>'G','Short for red in RGBR'=>'R','Insert/edit media'=>'Futni/përpunoni media','Insert/edit code sample'=>'Futni/përpunoni shembull kodi','Table of Contents'=>'Tabelë e Lëndës','Date/time'=>'Datë/kohë','Id for link anchor (TinyMCE)Id'=>'Id','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'Id duhet të fillojë me një shkronjë, pasuar vetëm nga shkronja, numra, vija ndarëse, pika, presje ose nënvija.','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'Mund të lëvizni nëpër faqe të tjera në sajtin tuaj teksa përdorni Përshtatësin për të parë dhe përpunuar widget-et e pranishme në këto faqe.','Your theme has %s widget area, but this particular page does not display it.'=>'Tema juaj ka %s fushë widget-esh, por kjo faqe e veçantë s’e shfaq atë.' . "\0" . 'Tema juaj ka %s fusha widget-esh, por kjo faqe e veçantë s’i shfaq ato.','Your theme has 1 widget area, but this particular page does not display it.'=>'Tema juaj ka 1 fushë widget-esh, por kjo faqe e veçantë s’e shfaq atë.','Your theme has %s other widget area, but this particular page does not display it.'=>'Tema juaj ka %s fushë tjetër widget-esh, por kjo faqe e veçantë s’e shfaq atë.' . "\0" . 'Tema juaj ka %s fusha të tjera widget-esh, por kjo faqe e veçantë s’i shfaq ato.','Your theme has 1 other widget area, but this particular page does not display it.'=>'Tema juaj ka 1 fushë tjetër widget-esh, por kjo faqe e veçantë s’e shfaq atë.','This address is used for admin purposes, like new user notification.'=>'Kjo adresë përdoret për qëllime administrimi, fjala vjen, njoftim për përdorues të ri.','Unique identifier for the term.'=>'Identifikues unik për termin.','Required to be true, as terms do not support trashing.'=>'Lypset të jetë <em>true</em>, ngaqë për termat nuk mbulohet shpënia te hedhurinat.','An alphanumeric identifier for the taxonomy.'=>'Identifikues alfanumerik për klasifikimin.','Required to be true, as revisions do not support trashing.'=>'Lypset të jetë <em>true</em>, ngaqë për rishikimet nuk mbulohet shpënia te hedhurinat.','REST base route for the post type.'=>'Rruga bazë REST për llojin e postimit.','An alphanumeric identifier for the post type.'=>'Identifikues alfanumerik për llojin e postimit.','Human-readable labels for the post type for various contexts.'=>'Etiketa të lexueshme nga syri i njeriut për llojin e postimit për kontekste të ndryshëm.','Whether or not the post type should have children.'=>'Të ketë apo jo pjella lloji i postimit.','A human-readable description of the post type.'=>'Një përshkrim i lexueshëm nga njeriu për llojin e postimit.','All capabilities used by the post type.'=>'Krejt aftësitë e përdorura nga lloji i postimit.','An alphanumeric identifier for the status.'=>'Një identifikues alfanumerik për gjendjen.','Limit response to comments published before a given ISO8601 compliant date.'=>'Kufizoje përgjigjen te koment